import React from "react";
import guildwars2 from "../api/guildwars2";
class App extends React.Component {
  something = async test => {
    await guildwars2
      .get("account", {
        params: {
          access_token:
            "2CD468CC-5140-514D-AC14-0AE5A8222E25E2CBE59F-5A64-4C26-8379-D3B9356CA701"
        }
      })
      .then(response => {
        console.log(response.data);
      })
      .catch(error => {
        console.log(error);
      });
  };
  render() {
    return <div>{console.log(this.something())}</div>;
  }
}

export default App;
